    <g id="btn-infravermelho" class="la-btn-active-ref la-btn-specter" title-ref="Raios Infravermelhos" number-ref="Ref. 04" data-ref="Tm comprimento de onda entre 700 nm e 50.000 nm.  um tipo de radiao de baixa energia, que fica na faixa de energia necessria para fazer os tomos de uma substncia vibrarem sem provocar uma reao, portanto,  uma radiao no ionizante. Muito usados em controles remoto e leitores de cdigo de barra.">
